              source={{
                uri: "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/data%2FmajorCities_QLD.png?alt=media&token=362b755e-205b-456f-b5db-b572a48c3060",
