            <Text style={styles.detailsText}>Land area: 983,482 sq. km</Text>
            <Text style={styles.detailsText}>People born overseas: 24%</Text>
            <Text style={styles.detailsText}>
              People speaking non-English language at home: 17.8%
            </Text>

