              source={{
                uri: "https://firebasestorage.googleapis.com/v0/b/journeytoaustralia-b21d4.appspot.com/o/data%2FmajorCities_SA.png?alt=media&token=0387eb51-1618-4214-ab81-ad4e5098838c",
